/*
Module: Talent and Rights
Last Updated: Adlina (24/2/2025), Adlina (5/2/2025)
High Level Steps:
    1. Add New Talent - Corporation
    2. Create Master
    3. Add Talent to Master
    4. Process Check Run
    5. Check Talent Batch
    6. "Corporation" will sync to a Work Authorization with Work Authorization Type of "Corporation"
*/
// Step 1 : Add New Talent - Corporation
const talentType = 'Corporation';
cy.generateTalents(talentType).then(() => {
    cy.readFile('src/fixtures/talent-data.json').then(() => {
        cy.createNewMultiTalents(talentType);
    });
});
// Step 2 : Create Master
cy.createTalentMaster();
// Step 3 : Add Talent to Master
cy.readFile('src/fixtures/talent-data.json').then((talents) => {
    const masterID = talents.masterID;
    const talentName = talents.corpName1;
    const talentId = talents.talentIDCorporation;
    cy.addCasttoTalentMaster(masterID, talentName, talentType, talentId);
    // Step 4 : Create Payment - Process Check Run
    cy.createTalentPayment(masterID, [`${talents.corpFName} ${talents.corpLName} [${talentName}]`]);
    // Update PaymentDetails
    cy.updatePaymentDetails();
    cy.processPayment();
    // Create Check Run
    cy.submitCheckRun();
});
// Step 5 : Check Talent Batch
cy.checkTalentbatch();
// Step 6 : Check Payee Sync
cy.visit(`${this.urls.payeeSearch}`);
cy.get('header.page-heading', { timeout: 50000 }).should('be.visible');
cy.get('.spinner-threedots', { timeout: 60000 }).should('be.visible');
cy.get('.spinner-threedots', { timeout: 60000 }).should('not.be.visible');
cy.readFile('src/fixtures/talent-data.json').then((talents) => {
    // Search for Payee
    cy.get('input[name="taxId"]', { timeout: 60000 }).should('be.visible').type(talents.feinCorporation);
});
// Search
cy.contains('button', 'Search').click({ force: true });
cy.get('div.k-loading-mask', { timeout: 5000 }).should('not.exist');
cy.wait(5000);
// Click the record - Corp ID hyperlink
cy.get('td[data-kendo-grid-column-index="2"]').first().find('a').click();
// Click Work Authorization tab
cy.contains('a', 'Work Authorizations', { timeout: 60000 }).click({ force: true });
cy.get('.spinner-threedots', { timeout: 60000 }).should('be.visible');
cy.get('.spinner-threedots', { timeout: 60000 }).should('not.be.visible');
// Work Authorization on Default - Corporation
cy.get('.search-results table tbody tr').each(($row) => {
    cy.wrap($row).find('td').eq(7).invoke('text').should('include', 'Corporation');
});

