/*
Last Updated : Rosnisa (05/02/2025)
Module : Talent Rights Regressions
High Level Test Step :
1. Visit Talent & Rights page > Talent Advices
2. Use type Foreign should be changed to Foreign Use for AFTRA radio
Foreign" has been changed to "Foreign use" on the Use Type dropdown for AFTRA radio Talent Advices
*/
cy.clearCookies();
cy.clearAllSessionStorage();
const userName = Cypress.env('PLATFORM_USER_USERNAME_PAYROLL_TALENT_AND_RIGHTS');
const password = Cypress.env('PLATFORM_USER_PASSWORD_PAYROLL_TALENT_AND_RIGHTS');
