cy.visit('/adbridge/tal/Talent/TalentAdvices#!/');
cy.get('.page-heading h1', { timeout: 90000 }).should('exist').and('have.text', 'Talent Advices');
cy.get('select#searchCriteria\\.TalentAdviceUseType', { timeout: 90000 }).should('be.visible');
cy.get('select#searchCriteria\\.TalentAdviceUseType option').then(($options) => {
    const optionTexts = $options.map((_, option) => Cypress.$(option).text().trim()).get();
    const foreignOptions = optionTexts.filter((text) => text.toLowerCase().includes('foreign'));
    cy.log('Filtered Foreign Options: ', JSON.stringify(foreignOptions, null, 2));
    console.log('Filtered Foreign Options:', foreignOptions);
    expect(foreignOptions).to.include('Foreign Use'); // Ensure "Foreign Use" is present
});
cy.get('[data-cy="er-profile-button"]').should('be.visible').click();
cy.get('a[data-clear-session-storage]').should('be.visible').click();

